import React from "react";

const Logo = () => (
  <div className="not-fancy-font flex flex-col ml-5 mt-8">
    <div className="text-white text-50 font-light tracking-12">NEEK</div>
    <div className="flex gap-3">
      <div className="bg-white h-2 w-115 border-white mt-2" />
      <div className="text-white text-16 uppercase">Software Engineer/ Story Teller</div>
    </div>
  </div>
);

export default Logo;
